import React from 'react';
import './NavBar.css';

const NavBar = () => {
  return (
    <div className="navbar">
      <a href="/" className="nav-item">Home</a>
      <a href="/about" className="nav-item">AK</a>
      <a href="/projects" className="nav-item">Projects</a>
    </div>
  );
};

export default NavBar;
